import React from 'react';
import styles from './Burgers.module.css';

function Burgers({title, price, weight, image}) {
    return (
        <div className="content_food">
<h3>БУргеры</h3>
<div className="burgers">
       
        <div className={styles.burger}>
            <img src={image} alt="" />
            <div className={styles.info}>
                <p className={styles.info_price}>{price}₽</p>
                <p className={styles.food_name}>{title}</p>
                <p className={styles.info_weight}>{weight}г</p>
            </div>
            <button className={styles.add}>Добавить</button>
        </div>
        </div>
        </div>
    )
}

export default Burgers;
